import React from 'react';

const projects = [
  {
    title: 'Project One',
    image: '/assets/project1.jpg', // Replace with your actual image path
    link: 'https://github.com/yourusername/project-one'
  },
  {
    title: 'Project Two',
    image: '/assets/project2.jpg',
    link: 'https://github.com/yourusername/project-two'
  },
  {
    title: 'Project Three',
    image: '/assets/project3.jpg',
    link: 'https://github.com/yourusername/project-three'
  },
  {
    title: 'Project Four',
    image: '/assets/project4.jpg',
    link: 'https://github.com/yourusername/project-four'
  },
  {
    title: 'Project Five',
    image: '/assets/project5.jpg',
    link: 'https://github.com/yourusername/project-five'
  },
  {
    title: 'Project Six',
    image: '/assets/project6.jpg',
    link: 'https://github.com/yourusername/project-six'
  }
];

const Projects = () => {
  return (
    <div className="bg-gray-900 min-h-screen text-white py-12 px-6">
      <div className="max-w-6xl mx-auto text-center mb-12">
        <h2 className="text-4xl font-bold mb-4">My Projects</h2>
        <p className="text-gray-400">A collection of my work demonstrating data analysis, visualization, and development skills.</p>
      </div>

      <div className="grid sm:grid-cols-2 lg:grid-cols-3 gap-8 max-w-6xl mx-auto">
        {projects.map((project, index) => (
          <a
            key={index}
            href={project.link}
            target="_blank"
            rel="noopener noreferrer"
            className="bg-gray-800 rounded-lg overflow-hidden shadow-md hover:shadow-pink-500/50 transition hover:scale-105"
          >
            <img
              src={project.image}
              alt={project.title}
              className="w-full h-48 object-cover"
            />
            <div className="p-4">
              <h3 className="text-xl font-semibold">{project.title}</h3>
            </div>
          </a>
        ))}
      </div>
    </div>
  );
};

export default Projects;
